// components/Hero.tsx
import React from 'react';
import Carousel from './Carousel';
const Hero: React.FC = () => {
  const slides = [
    'https://via.placeholder.com/600x400',
    'https://via.placeholder.com/500x400',
    'https://via.placeholder.com/800x400',
  ];

  return (
    <section className="relative py-52 my-5">
      <Carousel slides={slides} />

      <div className="absolute inset-0 bg-gray-800 bg-opacity-50 flex items-center justify-center">
        <div className="container mx-auto px-6 text-center">
          <h1 className="text-4xl font-bold leading-tight text-white mb-6">Discover Our Latest Collections</h1>
          <p className="text-xl text-white mb-8">Explore EarlyBird's premium fitness apparel.</p>
          <a
            href="#"
            className="bg-white text-gray-800 py-2 px-6 rounded-full font-semibold uppercase text-sm hover:bg-gray-200"
          >
            Shop Now
          </a>
        </div>
      </div>
    </section>
  );
};

export default Hero;
